import Foundation
#if os(OSX)
    import AppKit
#else
    import UIKit
#endif

class TestBundle {

    static let badSSLCertificate: Data? = {
        return Data(base64Encoded: TestBundle.badCertificateBase64)
    }()

    static let validSSLCertificate: Data? = {
        return Data(base64Encoded: TestBundle.validCertificateBase64)
    }()

    #if os(OSX)
    static let evilSpaceshipImage: NSImage? = {
        guard let data = Data(base64Encoded: TestBundle.evilSpaceshipBase64) else {
            return nil
        }
        return NSImage(data: data)
    }()

    static let cellTowersImage: NSImage? = {
        guard let data = Data(base64Encoded: TestBundle.cellTowersBase64) else {
            return nil
        }
        return NSImage(data: data)
    }()
    #else
    static let evilSpaceshipImage: UIImage? = {
        guard let data = Data(base64Encoded: TestBundle.evilSpaceshipBase64) else {
            return nil
        }
        return UIImage(data: data)
    }()

    static let cellTowersImage: UIImage? = {
        guard let data = Data(base64Encoded: TestBundle.cellTowersBase64) else {
            return nil
        }
        return UIImage(data: data)
    }()
    #endif

    static let sampleVideo: Data? = {
        return Data(base64Encoded: TestBundle.videoBase64)
    }()

}

extension TestBundle {

    // swiftlint:disable line_length

    fileprivate static let badCertificateBase64 = ""

    fileprivate static let validCertificateBase64 = ""

    fileprivate static let cellTowersBase64 = ""

    static fileprivate let evilSpaceshipBase64 = ""

    static fileprivate let videoBase64 = ""

    // swiftlint:enable line_length

}
